    const id = req.params.id;
    const loja = await lojaService.findById(id)
    res.json(loja);
  }

  async save(req, res) {
    try {
      const loja = await Loja.create(req.body);
      return res.send({ loja });
    } catch (error) {
      return res.status(400).send({ error: 'Falha no Registro ' })
    }

  }

